import s from "./Post.module.css"

const Post = (props) => {
 return (
   <div className={s.post}>
     <div className={s.item}>{props.message}</div>
     <div>
       <span>{props.likes} </span>
       <button>Like</button>
     </div>
   </div>
 );
}

export default Post;
